import React, {useState, useEffect} from 'react'
import BoxCountents from "./BoxContenents";

export default function ListBox(props) {
const [ListData, setListData] = useState(props.listData || []);

useEffect(() => {
    setListData(
    props.ListData.filter((listItem) => listItem.title == "pokemon")
    );
}, [props.ListData]);

    return (
        <div>
           {ListData.map((item, index)=>(
           <BoxCountents key={index} title={item.title} game={item.game} />
           ))}
        </div>
    )
}
